import React, { useEffect, useState } from "react";
import '../images/login.jpg';
import './7-UserHome.css'
const UserHome = () => {
    const [volunteering, setVolunteering] = useState([]);
    useEffect(() => {
        //fetch from node all volunteerings
        const data = [{
            name: 'זקנים',
            description: 'שהיה עם זקן ועזרה במה שיצטרך',
            imgUrl: ''
        },
        {
            name: 'זקנים',
            description: 'שהיה עם זקן ועזרה במה שיצטרך',
            imgUrl: ''
        },
        {
            name: 'זקנים',
            description: 'שהיה עם זקן ועזרה במה שיצטרך',
            imgUrl: ''
        }]
        setVolunteering(data)

    }, []);
    return <div className="volunteering-cards-wrapper">
        {volunteering?.map(v => (
            <div className="card" style={{ width: '18rem' }}>
                <div>{v.name}</div>
                <div className="card-img-top" style={{backgroundImage: url()}}></div>
                <div className="card-body">
                    <p className="card-text">{v.description}</p>
                </div>
            </div>
        ))
        }
    </div>

}
export default UserHome;
